import React from "react";
import logo from "../images/logo__image.svg";

function Header() {
  return (
    <header className="header">
      <img className="header__image" src={logo} alt="Место Россия" />
      <div class="header__info">
        <h2>email</h2>
        <h2>Выйти</h2>
      </div>
    </header>
  );
}

export default Header;
